        clss="active";
    }
    else{
        clss=hidden
    }
    return(
        
        <div className={`navbar ${clss}`}>
            <nav className="navbar_nav">
                <div className="nav_name">
                    <h2>MyBlog</h2>
                </div>
                <div className="nav_center">
                    <Link to=''>Link1</Link>
                    <Link to=''>Link2</Link>
                    <Link to=''>Link3</Link>
                    <Link to=''>Link4</Link>
                </div>
                <div className='nav_right'>
                    <h3>icon</h3>
                </div>
            </nav>
        </div>

    );
}
